function readServer() {  // this.readServer()
    this.get('ScoresText').setTextString('Looking for scores...');
    // If server is available, fetch high scores
    var server = this.getServer("QBFScoresServer/");
    var answer = server.get();
    if (!answer.status.isSuccess()) return this.regret();
    console.log("server ok");

    var allScores = JSON.parse(answer.content);
    // console.log(answer.content);

    // Make up a list of objects with userName and level in them
    var lineItems = [];
    Object.keys(allScores).forEach(function(userName) {
        var userObj = allScores[userName];
        Object.keys(userObj).forEach(function(level) {
            var lineItem = userObj[level];
            lineItem['level'] = level;
            lineItem['player'] = userName;
            lineItems.push(lineItem);
        });
    });

    // Now sort by level, gameScore
    lineItems.sort(function(a, b) {
        if (a.level > b.level) return 1;
        if (a.level < b.level) return -1;
        if (a.bestGame < b.bestGame) return 1;
        return -1;
    });

    // Finally assemble into a grid and use Grid.tablePrint
    var grid = [], level = 'none';
    grid.push(['game score', 'best word', 'score', 'player', 'time']);
    for (var i=0; i<lineItems.length; i++) {
        var item = lineItems[i];
        if (item.level != level) {
            level = item.level;
            grid.push([level, '', '', '', '']);
        }
        grid.push([item.bestGame.toString(), item.bestWord, item.bestWordScore.toString(), item.player, new Date(item.time).format('mmmm dd hh:mmtt')]);
    }
    this.get('ScoresText').setTextString(Strings.printTable(grid, {separator: ' | '}) + '\n      -- Scores will be reset each month --');
}

